import React from "react";
import { VStack, Icon } from "@chakra-ui/react";

import LargeLogo from "./assets/logo-full-large.svg";

function Sidebar({}) {
  return (
    <div className="sidebar">
      <VStack>
        <Icon as={LargeLogo} />
      </VStack>
    </div>
  );
}

export default Sidebar;
